import React from 'react'

const MenuCard = ({ menuData }) => {
    // console.log(menuData);
    return (
        <>

            {menuData.map((curElem) => {
                return (
                    <>
                        <div className='card-container'>
                            <div className='card'>
                                <div className='card-body'>
                                    <span className='card-number card-circle subtle'>1</span>
                                    <span className='card-author subtle'>BreakFast</span>
                                    <h2 className='card-title'> Maggi Sunny </h2>
                                    <span className='card-description subtle'>
                                        I love Maggi really oo yues Lorem ipsum dolor sit amet, consectetur adipisicing elit. Nam voluptatem a debitis reiciendis, sint autem necessitatibus esse accusantium veritatis ducimus.
                                    </span>
                                    <div className='card-read'>Read</div>
                                </div>
                                {/* <img src={Image} alt="image" className='card-media' /> */}

                                <span className='card-tag subtle'>Order Now</span>
                            </div>
                        </div>
                    </>
                )
            })}

        </>
    )
}

export default MenuCard
